import { Typography } from "antd";
import styled from "styled-components";

const { Title } = Typography;

export const StyledHomeTitle = styled(Title)`
  text-align: center;
`;

export const StyledTitle = styled(Title)`
  text-align: center;
  margin-bottom: 20px;
`;

export const StyledSubtitle = styled(Title)`
  text-align: center;
`;

export const StyledPrompt = styled(Title)`
    text-align: center;
    margin: 40px 0px;
`;
